 $(function () {
  $(document).scroll(function () {
    var $nav = $(".navbar-fixed-top");
    $nav.toggleClass('scrolled', $(this).scrollTop() > $nav.height());
  });
});

var topImage = $("#top-image")
var sketch = false;

 topImage.on('click', function(){
 	var sketchImage = $(topImage)
 	sketchImage.hide();
 	if (sketch === true) {
 		sketch = false;
 		sketchImage.attr('src', './images/GA_photo.JPG')
 	} else if (sketch === false) {
 		sketch = true;
 		sketchImage.attr('src', './images/benn-sketch.png')
 	}
 	sketchImage.fadeIn();
 })

 $('#lightbulb').click(function() {
 	var lightbulb = $('#lightbulb');
 	lightbulb.addClass('bounce').one("webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend", function(){
 		lightbulb.removeClass('bounce')
 	})
 });

$('a[href*="#"]').click(function(event){
	var target = $(this.hash);
	target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
	if (target.length) {
		event.preventDefault();
		$('html, body').animate({
			scrollTop: target.offset().top
		},1000)
	}
});

$('.interest ul').hide();

$('.interest-content').click(function(){
	$(this).next("ul").slideToggle();
	$(this).toggleClass('rotated');
	return false;
})

$(function() {
		$('.modalImage').on('click', function() {
			$('.imagepreview').attr('src', $(this).find('img').attr('src'));
			$('#imagemodal').modal('show');   
		});		
});
